import React, { useState } from 'react';

import Head from 'next/head';
import Meta from '../Meta';

import { HTML, Container, MenuWeb, MenuMobile } from './styles';

const Header: React.FC = () => {

  const [activeItem, setActiveItem] = useState('inicial');

  function handleItemClick(page: string) {
    alert(page);
    setActiveItem(page);
  }

  return (
    <>
      <Head>
        <title>Prazer, Cuby!</title>
        <Meta />
      </Head>
      <HTML>
        <h1>Hello, Header!</h1>
        <Container>
            <img src="./assets/logo_web.svg" onClick={() => handleItemClick('inicio')} />
            <MenuWeb>

            </MenuWeb>
            <MenuMobile>

            </MenuMobile>
        </Container>
      </HTML> 
    </>
  );
}

export default Header;
